import React from 'react';

const PlayerCard = ({ player }) => {
    return (
        <div className="player-card">
            <img src={player.image} alt={player.name} />
            <h2>{player.name}</h2>
            <p>Equipo: {player.team}</p>
            {/* Mostrar otras estadísticas del jugador */}
        </div>
    );
};

export default PlayerCard;
